// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

import "./IotaHeroFactory.sol";
import "./IotaHeroGameTokens.sol";

contract IotaHeroTokenTrade is Ownable {
    IotaHeroGameTokens public tokens;

    Trade[] public trades;
    uint256 tradeCounter = 0;
    enum TradeStatus {
        OPEN,
        FULFILLED,
        CANCELLED
    }
    struct Trade {
        uint256 tradeId;
        address tradeInitiator;
        uint256[] tokenIdsForSale;
        uint256[] amountsToSell;
        uint256[] tokenIdsWanted;
        uint256[] amountsWanted;
        TradeStatus tradeStatus;
    }
    mapping(uint256 => address) public tradeToOwner;

    event TradeCreated(
        uint256 indexed tradeId,
        address indexed creator,
        uint256[] tokenIdForSale,
        uint256[] amountsToSell,
        uint256[] tokenIdWanted,
        uint256[] amountsWanted
    );
    event TradeUpdated(
        uint256 indexed tradeId,
        address indexed updater,
        TradeStatus updatedStatus
    );

    modifier onlyOwnerOf(uint256 _tradeId) {
        require(tradeToOwner[_tradeId] == msg.sender);
        _;
    }

    function setTokenAddress(address _tokenAddress) public onlyOwner {
        tokens = IotaHeroGameTokens(_tokenAddress);
    }

    function getTokenAddress() public view returns (address) {
        return address(tokens);
    }

    function _checkBalances(
        address addr,
        uint256[] memory tokenArr,
        uint256[] memory balanceArr
    ) internal view returns (bool) {
        uint256[] memory balances = tokens.balanceOfBatch(
            _initArray(tokenArr.length, addr),
            tokenArr
        );
        for (uint256 i = 0; i < tokenArr.length; i++) {
            if (balances[i] >= balanceArr[i]) {
                return false;
            }
        }
        return true;
    }

    function _initArray(uint256 length, address value)
        internal
        pure
        returns (address[] memory)
    {
        address[] memory arr = new address[](length);
        for (uint256 i = 0; i < length; i++) {
            arr[i] = value;
        }
        return arr;
    }

    function setTradeOffer(
        uint256[] calldata tokenIdsForSale,
        uint256[] calldata amountToSell,
        uint256[] calldata tokenIdsWanted,
        uint256[] calldata amountWanted
    ) public {
        require(
            tokenIdsForSale.length == amountToSell.length &&
                tokenIdsWanted.length == amountWanted.length,
            "Array lengths don't match"
        );
        require(
            tokens.isApprovedForAll(msg.sender, address(this)),
            "You must approve first"
        );
        require(
            _checkBalances(msg.sender, tokenIdsForSale, amountToSell),
            "You don't have sufficient balance"
        );

        Trade memory trade = Trade(
            tradeCounter,
            msg.sender,
            tokenIdsForSale,
            amountToSell,
            tokenIdsWanted,
            amountWanted,
            TradeStatus.OPEN
        );
        trades.push(trade);
        tradeToOwner[tradeCounter] = msg.sender;

        emit TradeCreated(
            tradeCounter,
            msg.sender,
            tokenIdsForSale,
            amountToSell,
            tokenIdsWanted,
            amountWanted
        );
        tradeCounter++;
    }

    function cancelTradeOffer(uint256 _tradeId) public onlyOwnerOf(_tradeId) {
        Trade storage trade = trades[_tradeId];
        trade.tradeStatus = TradeStatus.CANCELLED;
        emit TradeUpdated(_tradeId, msg.sender, TradeStatus.CANCELLED);
    }

    function fulfillTradeOffer(uint256 _tradeId) public {
        Trade storage trade = trades[_tradeId];
        require(
            _checkBalances(
                msg.sender,
                trade.tokenIdsWanted,
                trade.amountsWanted
            ),
            "You don't have sufficient balance"
        );
        require(
            _checkBalances(
                trade.tradeInitiator,
                trade.tokenIdsForSale,
                trade.amountsToSell
            ),
            "Trade initiator doesn't have sufficient balance"
        ); // check that trader has the required tokens
        require(
            trade.tradeStatus == TradeStatus.OPEN,
            "Trade isn't active anymore"
        );
        require(
            tokens.isApprovedForAll(msg.sender, address(this)),
            "You must approve first"
        );
        tokens.safeBatchTransferFrom(
            msg.sender,
            trade.tradeInitiator,
            trade.tokenIdsWanted,
            trade.amountsWanted,
            ""
        );
        tokens.safeBatchTransferFrom(
            trade.tradeInitiator,
            msg.sender,
            trade.tokenIdsForSale,
            trade.amountsToSell,
            ""
        );
        trade.tradeStatus = TradeStatus.FULFILLED;
        emit TradeUpdated(_tradeId, msg.sender, TradeStatus.FULFILLED);
    }
}
